import React from "react";
import {
  Box,
  Grid,
  FilledInput,
  Select,
  MenuItem,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Typography,
  makeStyles,
  Button,
  IconButton,
  CircularProgress,
} from "@material-ui/core";

import { Close as CloseIcon } from "@material-ui/icons";


export default (props) => {
    return (
  <Dialog open={true} fullWidth>
        <DialogTitle>
            <Box></Box>
        </DialogTitle>
  </Dialog>
)
};
